import styled from 'styled-components'

const StyledHeader = styled.header`
    display: flex;
    height: 4em;
`;

const Header = () => {
    return (
        <StyledHeader>
            <button>Main Menu Icon</button>
            <h2>WMS </h2>
        </StyledHeader>
    )
}

export default Header
